const BoxMain = ({ data }) => {
    return (
        //<div style={boxLeftStyle}>HELLO</div>
        <div style={boxLeftStyle}>
            {data.map((city) => (
                <>
                    <p key={city.id}>{city.city}</p>
                    <br />
                    <p>{city.temperature}{city.unit}</p>
                </>
            ))
            }
        </div >
    )
}

const boxLeftStyle = {
    margin: 0,
    padding: 0,
    width: '100%',
    height: '44%',
    background: 'rgba(255, 255, 255, 0.8)',
    borderRadius: '25px',
    boxShadow: '5px 5px 10px 5px rgba(0,0,0,0.1)',
    display: 'flex',
    flexDirection: 'row',
}

export default BoxMain;
